import './Nav.css';

import { Link } from 'react-router-dom';






function Nav() {
    return(

        <>
        
        


        
        </>
    );
}

<div  className='nav-item my-3 w-28 '>
            <nav className="flex justify-center space-x-4">
                <Link to="/"><li className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Home</li></Link>
               <Link to="/team" > <li className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Team</li></Link>
                <Link to="/projects" ><li className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Projects</li></Link>
                <Link to="/reports" ><li  className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Reports</li></Link>
            </nav>

            
</div>

export default Nav;
